import React from "react";

function CreateQuestion()
{
	return (
		<div className="createForm">
		<fieldset>
			<legend>
				<h2>Question Creation Form</h2>
			</legend>
			<form>
				<label for="question_text">Question Text: </label>
			</form>
		</fieldset>
		</div>
	);
}

export default CreateQuestion;
